import logo from './logo.svg';
import { motion } from "framer-motion"; 
import './App.css';
import { useState } from "react";
import Cookies from "js-cookie";

function App() {
  const [drink, setDrink] = useState(null);
  const [position, setPosition] = useState({ x: 0, y: 0 });
  const [inputValue, setInputValue] = useState("");
  const [submittedText, setSubmittedText] = useState(null);

  const handleSubmit = () => {
    if (inputValue.trim() === "") return;
    setSubmittedText(inputValue);
    setInputValue("");
  };

  const getCookies = () => {
    console.log("User Cookies:", Cookies.get()); // Logs all cookies as an object
  };

  const fetchDrink = async () => {
    try {
      const response = await fetch("https://www.thecocktaildb.com/api/json/v1/1/random.php");
      console.log("Response Status:", response.status);

    if (!response.ok) {
      throw new Error(`HTTP error! Status: ${response.status}`);
    }
      const data = await response.json();
      console.log("API Response:", data.drinks);
      if (data.drinks && data.drinks.length > 0) {
        setDrink(data.drinks[0]); // Always set drink
        setPosition({
          x: Math.random() * 300, // Random X between -150 and 150
          y: Math.random() * 200, // Random Y between -100 and 100
        });
      } else {
        throw new Error("No drink data found!");
      }

    } catch (error) {
      console.log("Error catching:", error);
    }
  };
  return (
    <div className="container">


    <button className="drink-button" onClick={fetchDrink}>
      I'm Bored
    </button>

    {/* Wrap everything inside a single motion.div so it fully replaces previous drink */}
    <motion.div key={drink?.idDrink} className="drink-wrapper">
      {drink && (
        <motion.div
          className="drink-container"
          initial={{ opacity: 0, y: -20 }}
          animate={{ opacity: 1, y: 0 }}
          exit={{ opacity: 0, y: -20 }} // Ensures smooth replacement
          transition={{ duration: 0.5 }}
        >
          <h2>{drink.strDrink}</h2>

          {/* ðŸ”¥ Slam down & spin effect for image */}
          <motion.img
            src={drink.strDrinkThumb}
            alt={drink.strDrink}
            className="drink-image"
            initial={{ y: -300, opacity: 0, rotate: 0 }}
            animate={{ y: 0, opacity: 1, rotate: 9720 }}
            transition={{
              type: "spring",
              stiffness: 300,
              repeat: Infinity,
              damping: 10,
              duration: 0.6,

            }}
          />

          {/* ðŸ”¥ Instructions text bounces continuously */}
          <motion.p
            initial={{ x: 0, y: 0 }}
            animate={{ x: position.x, y: position.y, rotate: 9720 }}
            transition={{
              type: "spring",
              stiffness: 100,
              damping: 8,
              repeat: Infinity,
              repeatType: "reverse",
              duration: 1.5,
            }}
            className="instructions"
          >
            <strong>Instructions:</strong> {drink.strInstructions}
          </motion.p>
        </motion.div>
      )}
    </motion.div>
    <div>
      <input
        type="text"
        placeholder="Enter your name"
        value={inputValue}
        onChange={(e) => setInputValue(e.target.value)}
        className="text-input"
      />
      <button onClick={handleSubmit} className="submit-button">
        Submit
      </button>

      {submittedText && (
        <div className="output-container">
          <motion.p
            key={submittedText}
            className="flashing-text"
            initial={{ opacity: 0 }}
            animate={{
              opacity: [1, 0.5, 1], // Flash effect
              color: ["#ff0000", "#00ff00", "#0000ff", "#ffff00", "#ff00ff"], // Multi-color cycle
              x: [Math.random() * 80 - 40 + "vw", Math.random() * 80 + "vw"], // Random horizontal movement
              y: [Math.random() * 80 - 40 + "vh", Math.random() * 80 - 40 + "vh"], // Random vertical movement
            }}
            transition={{
              opacity: { repeat: Infinity, duration: 0.5 },
              color: { repeat: Infinity, duration: 0.5 },
              x: { repeat: Infinity, duration: 2, ease: "easeInOut" },
              y: { repeat: Infinity, duration: 2, ease: "easeInOut" },
            }}
          >
            {submittedText}
          </motion.p>
          <motion.img
            key={submittedText} // Ensures animation resets each time
            src="https://tauepsilonkappa.com/static/media/people/AndrewKasper.WebP"
            alt="Random Member"
            className="submitted-image"
            initial={{ y: -300, opacity: 0, rotate: 0 }} // Starts above screen
            animate={{ y: 0, opacity: 1, rotate: 9720, scale: [1, 2, 1] }}
            transition={{
              y: {
                type: "spring",
                stiffness: 200,
                damping: 5,
                repeat: Infinity,
                repeatType: "reverse",
                duration: 1.5,
              },
              rotate: {
                duration: 1.5,
                ease: "linear",
              },
              scale: {
                repeat: Infinity, // ðŸ”„ Keeps expanding and shrinking
                repeatType: "reverse",
                duration: 1, // Speed of scaling effect
                ease: "easeInOut",
              },
            }}
          />
        </div>
      )}
    </div>
    <button onClick={getCookies}>get cooked</button>
  </div>

  );
}

export default App;
